import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import api from '../services/api';

interface Tutor {
    id: number;
    headline: string;
    description: string;
    hourlyRate: number;
    user: {
        username: string;
    };
}

const TutorListPage: React.FC = () => {
    const [tutors, setTutors] = useState<Tutor[]>([]);
    const [subject, setSubject] = useState('');
    const [maxRate, setMaxRate] = useState('');

    useEffect(() => {
        fetchTutors();
    }, []);

    const fetchTutors = async () => {
        try {
            const response = await api.get('/api/profiles/tutor');
            setTutors(response.data);
        } catch (error) {
            console.error('Failed to fetch tutors', error);
        }
    };

    const handleSearch = async (e: React.FormEvent) => {
        e.preventDefault();
        try {
            const response = await api.get('/api/profiles/tutor/search', {
                params: { subject, maxRate: maxRate || null },
            });
            setTutors(response.data);
        } catch (error) {
            console.error('Search failed', error);
        }
    };

    return (
        <div>
            <h2>Find a Tutor</h2>
            <form onSubmit={handleSearch}>
                <input
                    type="text"
                    placeholder="Subject"
                    value={subject}
                    onChange={(e) => setSubject(e.target.value)}
                />
                <input
                    type="number"
                    placeholder="Max Hourly Rate"
                    value={maxRate}
                    onChange={(e) => setMaxRate(e.target.value)}
                />
                <button type="submit">Search</button>
            </form>
            <hr />
            <div>
                {tutors.map((tutor) => (
                    <div key={tutor.id} style={{ border: '1px solid #ccc', margin: '10px', padding: '10px' }}>
                        <h3>{tutor.headline}</h3>
                        <p>Tutor: {tutor.user.username}</p>
                        <p>{tutor.description}</p>
                        <p>Rate: ${tutor.hourlyRate}/hr</p>
                        <Link to={`/tutor/${tutor.id}`}>View Profile</Link>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default TutorListPage;
